// src/pages/Admin.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function Admin() {
  const navigate = useNavigate();

  return (
    <div className="text-center py-20 bg-gradient-to-r from-gray-200 to-gray-400 text-black">
      <h2 className="text-4xl font-bold mb-4">üë©‚Äçüíº Welcome, Admin!</h2>
      <p className="text-lg mb-8">Manage packages, view analytics, and more.</p>

      <div className="space-x-4">
        <button
          onClick={() => navigate('/admin/edit-packages')}
          className="bg-blue-600 text-white px-6 py-2 rounded-full font-semibold hover:bg-blue-700"
        >
          Edit Packages
        </button>
        <button
          onClick={() => navigate('/admin/view-packages')}
          className="bg-green-600 text-white px-6 py-2 rounded-full font-semibold hover:bg-green-700"
        >
          View Packages
        </button>
      </div>
    </div>
  );
}
